import React from "react";
import "../style/header.css";

const Header = () => {
    return (
        <div>
            <header>
                <h1>HighonCoding</h1>
                <h3>Home</h3>
                <h3>Categories</h3>
            </header>
        </div>
    );

}
export default Header;
